import React from "react";
import { useFormik } from "formik";
import axios from "axios";
import { useState } from "react";
import { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import { Toastify } from "toastify";
import { Container, Row, Col, Button, Form } from "react-bootstrap";
//

//

function HomePage() {
  return (
    <>
      <div className="container-fluid pt-4 px-4">
        <div className="card col">
          <div className="d-flex align-items-center gap-3 ">
            <div className="col-xl-3 col-sm-6 mb-3">
              <h6 className="fs-large fw-bold mbr-section-subtitle align-center text-dark mbr-light mbr-fonts-style display-1">
                DaarLib Reader
              </h6>
            </div>
            <div className="col-xl-3 col-sm-6 mb-3">
              <Row className="text-center mb-4">
                <Col>
                  <Button variant="outline-light" size="lg" block>
                    The Gutenberg Project
                  </Button>
                </Col>
                <Col>
                  <Button variant="outline-light" size="lg" block>
                    UE Daar
                  </Button>
                </Col>
              </Row>
              <Form inline className="d-flex justify-content-center">
                <Form.Control
                  type="text"
                  placeholder="Find books"
                  className="mr-2 form-control"
                />
                <Button variant="light">Search</Button>
              </Form>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default HomePage;
